import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const login = () => {
  return (
    <body style={{ margin: "0px" }}>
      <Box>
        <Box
          style={{
            marginLeft: "400px",
            marginRight: "400px",
            height: "600px",

            background: "#F2F3F7",
          }}
        >
          <Typography style={{ textAlign: "center" }}> Register </Typography>
        </Box>
      </Box>
    </body>
  );
};
export default login;
